<script lang="ts">
	import { browser } from '$app/environment';
	import cart from '$lib/stores/cart.svelte';
	import Seo from '$lib/components/Seo.svelte';
	import { onMount } from 'svelte';
	import appSettings from '$lib/stores/appSettings.svelte';
	import Separator from '../../../lib/components/Separator.svelte';

	onMount(() => {
		if (browser && !cart.loaded) {
			cart.load();
		}
	});
</script>

<Seo title="Carts - ChowBenin" description="View and manage your shopping carts." />

<div class="py-[20px]">
	<h3 class="text-[20px] font-extrabold">
		My cart {#if cart.keys.length > 0}<span class="text-text-muted">({cart.keys.length})</span>{/if}
	</h3>
</div>
{#if cart.loaded}
	{#if cart.keys.length > 0}
		<div class="mt-[8px] grid grid-cols-1 gap-[24px] md:grid-cols-2 lg:grid-cols-3">
			{#each cart.keys as key (key)}
				<div class="border-border flex flex-col rounded-lg border bg-[#fafafa] p-[20px]">
					{#if cart.carts[key]?.restaurantDetails}
						<div class="flex justify-between gap-2 mb-[30px] items-center">
							<h2 class="text-lg font-extrabold">{cart.carts[key].restaurantDetails.name}</h2>

							<a
								href="/restaurants/{cart.carts[key].restaurantDetails.slug}"
								class="flex items-center rounded-full bg-[#f2f2f2] px-[14px] py-[8px] text-sm"
							>
								<span class="mr-[4px]">
									Edit Selection
								</span>

								<svg
									width="12"
									height="12"
									viewBox="0 0 12 12"
									fill="none"
									xmlns="http://www.w3.org/2000/svg"
								>
									<path
										d="M4 2L7.375 5.375L4 8.75"
										stroke="#1E1E1E"
										stroke-linecap="round"
										stroke-linejoin="round"
									/>
								</svg>
							</a>
						</div>
					{/if}
					{#if cart.carts[key]?.items.length > 0}
					<div class="space-y-[24px]">
						<div class="flex flex-col rounded-[7px] bg-white p-[12px]">
							<ul class="space-y-2 text-sm">
								{#each cart.carts[key].items as item, index (index)}
									<li class="flex items-center justify-between">
										<div>
											<p>{item.name} x {item.quantity}</p>
										</div>
										<div class="relative">
											<p>
												<!-- Calculated Price: -->
												{appSettings.formatPrice(
													item.discount_price
														? item.discount_price * item.quantity
														: item.price * item.quantity
												)}
											</p>
										</div>
									</li>
									{#if index < cart.carts[key].items.length - 1}
										<Separator py="16px" />
									{/if}
								{/each}
							</ul>
						</div>

						<!-- Total -->
						<div class="flex items-center justify-between px-[12px]">
							<span class=" font-semibold">Total:</span>
							<span class="font-semibold">
								{appSettings.formatPrice(cart.carts[key].total)}
							</span>
						</div>
						<div>
							<a href="/checkout?restaurant={key}" class="btn rounded-full btn-primary block text-center">
								Proceed
							</a>
							<button
								onclick={() => {
									cart.deleteCart(key);
								}}
								class="btn text-[#FF2D2D] bg-transparent hover:bg-transparent mt-[4px] w-full block text-center"
							>
								Clear Cart
							</button>
						</div>
					</div>
					{:else}
						<p>No items in this cart.</p>
					{/if}
				</div>
			{/each}
		</div>
	{:else}
		<div class="flex min-h-[500px] flex-col items-center justify-center">
			<svg
				width="162"
				height="162"
				viewBox="0 0 162 162"
				fill="none"
				xmlns="http://www.w3.org/2000/svg"
				xmlns:xlink="http://www.w3.org/1999/xlink"
			>
				<rect width="162" height="162" fill="url(#pattern0_549_70)" />
				<defs>
					<pattern
						id="pattern0_549_70"
						patternContentUnits="objectBoundingBox"
						width="1"
						height="1"
					>
						<use xlink:href="#image0_549_70" transform="scale(0.00116822)" />
					</pattern>
					<image
						id="image0_549_70"
						width="856"
						height="856"
						preserveAspectRatio="none"
						xlink:href="data:image/png;base64,"
					/>
				</defs>
			</svg>

			<p class="text-text-muted mt-[8px] text-sm">No items added to cart</p>
				<a href="/" class="btn mt-4 rounded-full">Browse Restaurants</a>
		</div>
	{/if}
{:else}
	<div class="flex h-[500px] items-center justify-center">
		<iconify-icon icon="eos-icons:loading" width="30" height="30"></iconify-icon>
	</div>
{/if}
